import Kalyan from './Images/Candere.png';
import Tanishq from './Images/tanishq.png';
import Cartlane from './Images/cartlane.jpg'

const PartnerLogo = [{ id: 1, logo: Kalyan, PName: "Kalyan" }, { id: 2, logo: Tanishq, PName: "Tanishq" }, { id: 3, logo: Cartlane, PName: "Cartlane" }];

export default PartnerLogo;
